import { useState } from 'react';
import './App.css';

function App() {
  const [state,setstate]=useState("blue")
  function changer(){
    setstate("black")
  }
  return (
    <div className="App">
      <h1>{state}</h1>
      <button onClick={changer}>Click me</button>
    </div>
  );
}

export default App;
